INSERT INTO `rating` (`rt_ID`, `rt_r_ID`, `rt_user`, `rt_title`, `rt_text`, `rt_averageRating`, `rt_pricingRating`, `rt_ambienteRating`, `rt_serviceRating`, `rt_foodRating`, `rt_date`) VALUES
(1, 1, 'GenevieveDonin', 'Vegan approved', 'I was a bit sceptical to go to this tapas style restaurant. However they had a fair amount of vegan selections that were DELICIOUS. Just the right amount of food, the only reproach was that it was a tad crowded and loud. But otherwise it was one of my favourite restaurants in LA.', 5, -1, -1, -1, -1, 'August 24, 2013'),
(2, 1, 'LillyfromLA', 'Calling all foodies!', 'This place is ALL about flavor! If you have an adventurous pallet and care about your dining experience, then this is the place to eat! Everything is paired well together, and while the portions are small, you can eat a variety of items off the menu and explore. Reservations are a tad complicated, but I think that''s because they are working with a small dining space. Come here for good eats and drinks. Prices are on the high side so don''t come here starving - just with enough of an empty belly to treat yourself to some wonderful food!', 4, 3, 4, 5, 5, 'August 15, 2013'),
(3, 1, 'HolaYuma', 'Fresh food, awesome drinks!', 'If you''re in the LA area, you *MUST* come into Baco Mercat. They use fresh ingredients and have the best tasting cocktails too. I honestly recommend everything on the menu!', 5, 4, 5, 5, 5, 'August 15, 2013'),
(4, 1, 'AdobeDog', 'Fabulous food', 'The menu at Baco Mercat just cannot be explained. It is unique and the chef a real gem! They have family style to share dishes like Okra in tomato sauce and pork belly raviolis. The beef tongue sandwich (their baco) is to die for really a 5 pig rating!', 5, 5, 5, 4, 5, 'August 13, 2013'),
(5, 1, 'kenvils', 'Good food, reservations too complicated', 'First note, photos of the restaurant indicate a ''cozy'' small room - There''s more to it. They have an open room in front with a walk up bar (but, very small). it''s a location you can hit other restaurants near by if they won''t seat you.We crashed because we''ve tried reservations 3 times in the last 3 months and they''re hard to figure out. We at a the bar and fairly happy. bar tenders where great, knew the menu and mixed solid drinks.Food was good, but not extraordinary - we should sit down to really make a call on the food. I''d say it was a perfectly nice downtown restaurant, but i wouldn''t go out of my way and i wouldn''t wait for more than 20 minutes. again, we did not sit in the dining room, the experience may be exceptional there.', 4, 2, 3, 5, 4, 'August 5, 2013'),
(6, 1, 'Met_Prof', 'Creative food but is it healthy?', 'Had a fun evening at Baco Mercat. The buzz is that this place is were one gets reasonably priced food that is creative and delicious. For the most part, that is true. We were seated promptly. The restaurant is small and has a lively hip atmosphere. The wait staff was outstanding, not hovering but attentive. There are many options to select small plates or larger ones. The drink menu is large with a number of excellent beers, such as Maui Porter. After conferring with our waiters we decided on a back, a couple of vegetable dishes and a coca. The baco was the soft shelled crab, which was topped with cole slaw. The crab was not too soft, had shell that we had to pull out of our mouths and was also greasy. The cole slaw was loaded with mayo. The squash blossoms and caramelized cauliflower came out second. Both were excellent, particularly the cauliflower. The squash blossoms were very tasty but dripping in grease. Last up was the mushroom coca, a delicious flatbread pizza. This was cooked ', 5, 5, 4, 5, 4, 'July 28, 2013'),
(7, 1, 'AMG789', 'Delectable Flavors', 'Wow. That''s how I am starting this review. The different varieties & tastes we experienced on the evening of 7/7/13 were simply amazing! We went early, around 5 PM (a Sunday night), and by the time we were settled outside on the patio, where the noise level was very low, and people watching is very high, every single table was occupied. We decided to try 2 different "Baco sandwiches". With our waitress'' assistance, we settled on "the toron" & "the original". Both were simply amazing, and dripping with flavor, though both were vastly different from one another. From the vegetable section, we decided on the caramelized cauliflower, which had a zing to it,tamed by the touch of labni (a yogurt-like Lebanese concoction that tastes much richer), We also ordered the hamachi crudo, which was listed under fish, but was more appropriately an appetizer, given its somewhat small portion. Its accompanying "hash brown" was a misnomer, as it was the lightest, fluffiest & most delicious fried anything', 5, 4, 4, 5, 5, 'July 11, 2013'),
(8, 1, 'dara09', 'Delicious food with unique flavors in DTLA', 'One of my favorite casual eateries in LA - their bacos (apparently baco is a made up name for their signature flatbread sandwich) are fabulous. The fava fritter baco (the fritter is like a falafel) is amazing, and so is "the Original" baco with chunks of deep fried pork - oh my. Everything on the menu is amazing, but lately I''ve been focusing on their vegetable-focused dishes rather than the proteins. It''s hard to make vegetable interesting, but they managed to do it and the sauces are plate licking good. The small plates change regularly, but the roasted vegetables of any sort (I''ve had beets, cauliflowers, snap peas, carrots) and the salads truly show you what delicious things one can do with vegetables. Oh, their salmorejo sauce is to die for - get any dish that has it (the fava fritter baco does, and it makes an appearance on some veggie small plates).It''s in a rough part of downtown LA (some say gentrifying, what can you say, I''m spoiled princess - I say rough), I''ve only been the', 5, 5, 5, 5, 5, 'July 5, 2013'),
(9, 1, 'Jose K', 'Surprisingly different', 'We went there on a Sunday evening - luckily with reservations - as the place was packed. And loud, way too loud. But the menu provided soooo many interesting combinations that we forgot about the noisy. Don´t do if you don´t like to try new combinations and/or spices. Though the location is far from usual (specially if you are staying in Beverly Hills!), it´s definitely worth the trip.', 5, 4, 3, 4, 5, 'July 5, 2013'),
(10, 1, 'clovellyjel', 'Mescal alert!', 'This funky Downtown LA space is the plane to be right now. The food was delicious. We started with their homemade labne, followed by the cauliflower. Best ever. The lamb pizza was very tasty too but the much lauded shrimp baco was a disappointment. There was just too much going on for my palate - fried flat bread, deep fried breaded shrimps, coleslaw & srichacha mayonnaise. We were also uninitiated to the taste of the mescal cocktail which was strong, smokey & again for our palates, undrinkable. Nevertheless the overall experience was fabulous. We will be back.', 4, 4, 4, 4, 5, 'July 1, 2013');
